begin
wwv_flow_imp_shared.create_plugin(
 p_id=>wwv_flow_imp.id(100097362256058398871)
,p_plugin_type=>'DYNAMIC ACTION'
,p_name=>'GHAZI_JSPDF'
,p_display_name=>'jspdf print pdf plugin'
,p_category=>'EXECUTE'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'function json_ajax (p_dynamic_action in apex_plugin.t_dynamic_action',
'                   ,p_plugin         in apex_plugin.t_plugin )',
'  return apex_plugin.t_dynamic_action_ajax_result',
'is',
'  l_cur    sys_refcursor;',
'  l_result apex_plugin.t_dynamic_action_ajax_result;',
'  ',
'begin',
'  open l_cur for regexp_replace( rtrim ( p_dynamic_action.attribute_01, '';''), ''([^a-zA-Z0-9]|[\s=]):([a-zA-Z0-9_]*)'', ''\1 (select V(''''\2'''') from dual) '');',
'          ',
'  apex_json.open_object;     ',
'  apex_json.write(''data'',l_cur);',
'  apex_json.close_object;',
'   ',
'  return l_result;',
'end json_ajax;',
'',
'function render(p_dynamic_action in apex_plugin.t_dynamic_action',
'               ,p_plugin         in apex_plugin.t_plugin )',
'  return apex_plugin.t_dynamic_action_render_result',
'is',
'  l_js            varchar2(32767);',
'  l_render_result apex_plugin.t_dynamic_action_render_result;',
'  l_items_submit  apex_application_page_regions.ajax_items_to_submit%type := null;',
'  ',
'  l_filename      apex_application_page_items.attribute_02%type := trim(p_dynamic_action.attribute_02);',
'  l_title         apex_application_page_items.attribute_03%type := trim(p_dynamic_action.attribute_03);',
'  l_tablecolor    apex_application_page_items.attribute_04%type := coalesce(trim(p_dynamic_action.attribute_04),''#2782D2'');',
'  l_font          apex_application_page_items.attribute_05%type := coalesce(trim(p_dynamic_action.attribute_05),''arial'');',
'  l_font_size     apex_application_page_items.attribute_07%type := coalesce(trim(p_dynamic_action.attribute_07),12);',
'  l_group_column  apex_application_page_items.attribute_08%type := trim(p_dynamic_action.attribute_08);',
'  l_total_column  apex_application_page_items.attribute_09%type := trim(p_dynamic_action.attribute_09);',
'',
'begin',
'   apex_javascript.add_library(p_name => ''jspdf.umd.min''',
'                             ,p_directory => p_plugin.file_prefix',
'                             ,p_version => null);  ',
'                            --    apex_javascript.add_library(p_name => ''jspdf.min''',
'                            --  ,p_directory => p_plugin.file_prefix',
'                            --  ,p_version => null);',
'--   apex_javascript.add_library(p_name => ''jspdf.debug''',
'--                              ,p_directory => p_plugin.file_prefix',
'--                              ,p_version => null);',
'              ',
'  apex_javascript.add_library(p_name => ''jspdf.plugin.autotable.min''',
'                             ,p_directory => p_plugin.file_prefix',
'                             ,p_version => null);    ',
'                             ',
'  apex_javascript.add_library(p_name => ''Color''',
'                             ,p_directory => p_plugin.file_prefix',
'                             ,p_version => null);     ',
'                                ',
'                             ',
'  if p_dynamic_action.attribute_06 is not null then',
'    l_items_submit := p_dynamic_action.attribute_06;',
'  end if;   ',
'  l_js := q''[function dowload_pdf() {',
'    const { jsPDF } = window.jspdf;',
'   // const doc = new jsPDF();',
'     const    doc    = new jsPDF("portrait", "pt");',
'    var filename   = "#FILENAME#";',
'    var title      = "#TITLE#";',
'    var tablecolor = "#TABLECOLOR#";',
'    var tfont      = "#FONT#";',
'    var tfontsize  = "#FONT_SIZE#";',
'    var groupColumn = "#GROUP_COLUMN#";',
'    var totalColumn = "#TOTAL_COLUMN#";',
'    var header     = '''';',
'    var columns    = [];',
'    var rgbcode;',
'',
'    doc.addFont("https://rawcdn.githack.com/MrRio/jsPDF/cbc85b4bb66d5c1a2d50d199e8bf33836f2f12d7/test/reference/Amiri-Regular.ttf", "Amiri", "normal");',
'   // doc.addFont("#APP_FILES#Amiri-Regular.ttf", "Amiri", "normal");',
' ',
'    ',
'    doc.setFont("Amiri"); // set font',
'',
'    const pageWidth = doc.internal.pageSize.width;',
'    let yPosition = 20;',
'    const billToX = pageWidth / 2;',
'',
'    // Add the title at the top of the page',
'    if(title !== undefined) {',
'        doc.setFontSize(20);',
'        doc.setTextColor(0, 0, 0); // Black color',
'        doc.text(title, billToX, yPosition, { align: ''center'' });',
'        yPosition += 20; // Move down for the next line',
'    }',
'    doc.text(35, 25, title);  ',
'    // Add a blank line',
'    doc.setFontSize(15);',
'    doc.setTextColor(100, 100, 100); // Gray color',
'    doc.text(title, billToX, yPosition, { align: ''center'' });',
'    yPosition += 10; // Move down for the next line',
'',
'    rgbcode = hexToRgb(tablecolor);',
'',
'    apex.server.plugin("#DATA#", {pageItems: "#PAGEITEMS#"}, {',
'        success: function(Data) {',
'            var data = Data;',
'',
'            for (var p in data) {',
'                var e1 = data[p];',
'                for (var key2 in e1) {',
'                    var e2 = e1[key2];',
'                    columns += Object.keys(e2) + ",";',
'                }',
'            }',
'',
'            columns = columns.split(",").slice(",", -1);',
'            columns = Array.from(new Set(columns));',
'',
'            var arrayLength = columns.length;',
'            for (var i = 0; i < arrayLength; i++) {',
'                header += ''{"title":"'' + columns[i] + ''","dataKey":"'' + columns[i] + ''"},'';',
'            };',
'',
'            header = "[" + header.slice(",", -1) + "]";',
'            var result = JSON.parse(header);',
'',
'            let processedData = Object.values(data.data);',
'            let finalData = [];',
'',
'            if (groupColumn && groupColumn.trim() !== '''') {',
'                // Group the data',
'                let groupedData = {};',
'                processedData.forEach(row => {',
'                    let groupKey = row[groupColumn];',
'                    if (!groupedData[groupKey]) {',
'                        groupedData[groupKey] = [];',
'                    }',
'                    groupedData[groupKey].push(row);',
'                });',
'',
'                // Process each group',
'                for (let group in groupedData) {',
'                    // 1. Add group header row',
'                    let groupHeaderRow = {};',
'                    groupHeaderRow[groupColumn] = ''Group: '' + group;',
'                    finalData.push(groupHeaderRow);',
'',
'                    // 2. Add all detail rows for this group',
'                    finalData = finalData.concat(groupedData[group]);',
'',
'                    // 3. Add total row if totalColumn is specified',
'                    if (totalColumn && totalColumn.trim() !== '''') {',
'                        let total = groupedData[group].reduce((sum, row) =>',
'                            sum + (parseFloat(row[totalColumn]) || 0), 0);',
'',
'                        let totalRow = {};',
'                        totalRow[groupColumn] = ''Total for '' + group;',
'                        totalRow[totalColumn] = total;',
'                        finalData.push(totalRow);',
'                    }',
'',
'                    // Add empty row for spacing between groups',
'                    finalData.push({});',
'                }',
'            } else {',
'                finalData = processedData;',
'            }',
'',
'            doc.autoTable(result, finalData, {',
'                styles: {',
'                    font: tfont',
'                },',
'                headerStyles: {',
'                    fillColor : rgbcode,',
'                    fontSize: tfontsize',
'                },',
'                bodyStyles: {',
'                    fontSize: tfontsize',
'                },',
'                // Add custom styling for group headers and totals',
'                createdCell: function(cell, data) {',
'                    if (cell.raw && (',
'                        String(cell.raw).startsWith(''Group:'') ||',
'                        String(cell.raw).startsWith(''Total for'')',
'                    )) {',
'                        cell.styles.fontStyle = ''bold'';',
'                        cell.styles.textColor = [0, 0, 128];  // Dark blue color',
'                    }',
'                },',
'                   didDrawPage: function (data) {',
'               ',
'                doc.setFontSize(10);',
'                doc.text("Page " + doc.internal.getNumberOfPages(), doc.internal.pageSize.width - 40, doc.internal.pageSize.height - 10);',
'            },',
'            });',
'            doc.save(filename);',
'        }',
'    });',
'}]'';',
'          ',
'  l_js := replace(l_js, ''#FILENAME#''  ,l_filename);',
'  l_js := replace(l_js, ''#TITLE#''     ,l_title);',
'  l_js := replace(l_js, ''#TABLECOLOR#'',l_tablecolor);',
'  l_js := replace(l_js, ''#FONT#''      ,l_font);',
'  l_js := replace(l_js, ''#FONT_SIZE#'' ,l_font_size);',
'  l_js := replace(l_js, ''#DATA#''      ,apex_plugin.get_ajax_identifier);',
'  l_js := replace(l_js, ''#PAGEITEMS#'' ,l_items_submit);',
'  l_js := replace(l_js, ''#GROUP_COLUMN#'', l_group_column);',
'  l_js := replace(l_js, ''#TOTAL_COLUMN#'', l_total_column);',
'          ',
'  l_render_result.javascript_function := l_js;',
'  ',
'  return(l_render_result);        ',
'end render;'))
,p_api_version=>1
,p_render_function=>'render'
,p_ajax_function=>'json_ajax'
,p_standard_attributes=>'BUTTON:REGION'
,p_substitute_attributes=>true
,p_version_scn=>15595203212403
,p_subscribe_plugin_settings=>true
,p_version_identifier=>'1.0'
,p_about_url=>'https://github.com/ghazi201510'
,p_files_version=>16
);
